            {imageUri && (
                <View style={{flex: 1, justifyContent: 'center', alignItems: 'center'}}>
                    <Image 
                        source={{ uri: imageUri }}
                        style={{ width: '100%', height: '100%', resizeMode: 'contain' }}
                    />
                    <Button title="SchlieÃŸen" onPress={onClose} />
                </View>
            )}
        </View>
    );
}

const styles = StyleSheet.create({
    editorContainer: {
        flex: 1,
